import React from "react";

const Login = () => {
	return (
    <div className='flex flex-col justify-center min-h-screen py-12 bg-gray-50 sm:px-6 lg:px-8'>
      <div className='sm:mx-auto sm:w-full sm:max-w-md'>
        <h2></h2>
      </div>
    </div>
	);
};

export default Login;
